import React from 'react'
import styled from 'styled-components'
import { Search } from '@material-ui/icons/';

const Container = styled.div`
  background : black;
  width : 100%;
  height : 70px;
  //padding: 10px 20px;
  display: flex;
  justify-content: center;
  align-items: center;
`
const Wrapper = styled.div`
  display :flex;
  background-color: white;
  width: 98%;
  height: 80%;
  justify-content: space-between;
  align-items: center;
`
const Left = styled.div`
  flex:1;
  display: flex;
  align-items: center;
`
const Language = styled.div`
  font-size: 1.2em;
  font-weight: 500;
  margin: 0  10%;
`
const Searchbar = styled.div`
  display: flex;
  align-items: center;
  border: 1px solid lightgray;
  height: 25px;
  width: 40%;
  padding: 1%;
`
const Input = styled.input`
  width: 100%;
  height: 100%;
  border:none;
`
const Center = styled.div`
  flex:1;
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 2em;
  font-weight: 300;
  color: #444444;
`
const Right = styled.div`
  flex:1;
  display: flex;
  align-items: center;
  justify-content: flex-end;
  font-size: 1em;
  font-weight: 300;
  color: #444444;
`

export default function Navbar() {
  return (
    <Container>
      <Wrapper>
        <Left>
          <Language>EN</Language>
          <Searchbar>
            <Input />
            <Search />
          </Searchbar>
        </Left>
        <Center>
          E-Commerce.
        </Center>
        <Right>
          Register
          Sign In
        </Right>
      </Wrapper>
    </Container>
  )
}
